// BSLLexerInit initializes any static state used to implement BSLLexer. By default the
// static state used to implement the lexer is lazily initialized during the first call to
// NewBSLLexer(). You can call this function if you wish to initialize the static state ahead
// of time.
func BSLLexerInit() {
	staticData := &bsllexerLexerStaticData
	staticData.once.Do(bsllexerLexerInit)
}

// NewBSLLexer produces a new lexer instance for the optional input antlr.CharStream.
func NewBSLLexer(input antlr.CharStream) *BSLLexer {
	BSLLexerInit()
	l := new(BSLLexer)
	l.BaseLexer = antlr.NewBaseLexer(input)
	staticData := &bsllexerLexerStaticData
	l.Interpreter = antlr.NewLexerATNSimulator(l, staticData.atn, staticData.decisionToDFA, staticData.predictionContextCache)
	l.channelNames = staticData.channelNames
	l.modeNames = staticData.modeNames
	l.RuleNames = staticData.ruleNames
	l.LiteralNames = staticData.literalNames
	l.SymbolicNames = staticData.symbolicNames
	l.GrammarFileName = "BSLLexer.g4"
	// TODO: l.EOF = antlr.TokenEOF

	return l
}

